script: |
  super -f text -I q3591.spq | sort > q3591.out

inputs:
  - name: q3591.spq
    data: |
      SELECT ALL 51 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT ( col1 + - ( 78 ) ) >= ( - 84 + ( col0 ) * + col1 );
  - name: tab2

outputs:
  - name: q3591.out
    data: |
      51
      51
      51
